import React from 'react'
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';
import Image from 'react-bootstrap/Image';
import '../mainprofile.css';
export default function Mainprofile() {

  return (
    <Container>
        <Row className = "profile-page-sides">
            <Col sm={7} className = "profile-sections">
                <Card style={{ width: '20rem' }}>
                <Card.Img variant="top" src="https://media.istockphoto.com/id/1407271745/photo/gray-background.jpg?s=1024x1024&w=is&k=20&c=ah67tdX7sLctDaZwTW-ORK8pAEWDLFb0bKvye8GZ76c="/>

                <Card.Body>
                    <Card.Title>Card Title</Card.Title>
                    <Card.Text>
                    Some quick example text to build on the card title and make up the
                    bulk of the card's content.
                    </Card.Text>
                    <Button variant="primary">Go somewhere</Button>
                </Card.Body>
                </Card>
            </Col>
        </Row>
  </Container>
  )
}
